const initialValue = { data: [] };

const ReceivedData = (state = initialValue, action) => {
    const { email, firstName, lastName } = action.user;
    switch (action.type) {
        case "Received_Data": return {
            ...state, data: [{}]
        };
        default: return state;
    }
}

export default ReceivedData;
